// src/pages/AboutPage.js
import React from 'react';
import './AboutPage.css';

const AboutPage = () => {
  return (
    <div className="about-page">
      <div className="about-content container">
        <h1>About Us</h1>
        <p>
          Welcome to E-Library, your ultimate destination for exploring a vast collection of books and resources. Our mission is to make knowledge and learning accessible to everyone, regardless of location or background.
        </p>
        <p>
          We offer a wide range of genres and categories, from classic literature to the latest bestsellers. Our platform is designed to provide a seamless reading experience with easy navigation and powerful search capabilities.
        </p>
        <p>
          Our team is passionate about books and technology, and we continuously strive to enhance our library with new and exciting features. We believe in the power of reading to transform lives and are committed to helping you find your next great read.
        </p>
      </div>
    </div>
  );
};

export default AboutPage;
